INSERT INTO `about_translations` (`id`, `about_id`, `languages_code`, `title`, `content`, `meta_title`, `meta_description`) VALUES
(1, 1, 'ru', 'О компании', '<p>ООО &laquo;Мультимодальный логистический сервис&raquo; (MLS) &mdash; ваш надежный партнер в сфере транспортных услуг. Мы специализируемся на контейнерных перевозках, обеспечивая точность, эффективность и надежность в доставке. Наш опыт и актуальная информация о рынке позволяют нам предлагать лучшие логистические решения для вашего бизнеса. Сделайте логистику проще и выгоднее с MLS.</p>\n<h2>Миссия MLS</h2>\n<p>Нашей главной задачей является поддержка развития вашего бизнеса. Мы предлагаем эффективные логистические решения, сокращая ваши расходы и обеспечивая безопасную и своевременную доставку грузов.</p>\n<h2>Преимущества сотрудничества с нами</h2>\n<p>Сотрудничество с MLS &mdash; упрощение и оптимизация вашей логистики. Мы заботимся о каждой детали, чтобы ваша доставки стали более эффективными и выгодными.</p>', 'О компании', 'MLS — ваш надежный партнер в сфере транспортных услуг. Мы специализируемся на контейнерных перевозках, обеспечивая точность, эффективность и надежность в доставке.'),
(2, 1, 'en', 'About', '<p>Multimodal Logistics Service LLC (MLS) is your reliable partner in the field of transportation services. We specialize in container transportation, ensuring accuracy, efficiency, and reliability in delivery. Our experience and up-to-date market information enable us to offer the best logistics solutions for your business. Simplify and make logistics more profitable with MLS.</p>\n<h2>Mission of MLS</h2>\n<p>Our main objective is to support the development of your business. We offer efficient logistics solutions, reducing your costs and ensuring safe and timely delivery of goods.</p>\n<h2>The advantages of partnering with us</h2>\n<p>Collaborating with MLS means simplifying and optimizing your logistics. We take care of every detail to make your deliveries more efficient and cost-effective.</p>', 'About', 'MLS is your reliable partner in the field of transportation services. We specialize in container transportation, ensuring accuracy, efficiency, and reliability in delivery.');
