INSERT INTO `containers_translations` (`id`, `containers_id`, `languages_code`, `title`, `description`) VALUES
(1, 1, 'ru', '20 футовый контейнер стандартный / повышенной грузоподъемности', 'Используются для перевозки различных штучных грузов, крупных грузовых единиц и мелкоштучных грузов без тары в упаковке или в облегченной таре, так же личных вещей при переездах, различных товаров.'),
(2, 2, 'ru', '40 футовый морской контейнер стандартный / повышенной грузоподъемности', 'Используются для перевозки различных штучных грузов, крупных грузовых единиц и мелкоштучных грузов без тары в упаковке или в облегченной таре, так же личных вещей при переездах, различных товаров.'),
(3, 3, 'ru', '40 футовый контейнер повышенной вместимости', 'Используются для перевозки различных штучных грузов, крупных грузовых единиц и мелкоштучных грузов без тары в упаковке или в облегченной таре, так же личных вещей при переездах, различных товаров.'),
(4, 4, 'ru', '45 футовый контейнер повышенной вместимости', 'Используются для перевозки различных штучных грузов, крупных грузовых единиц и мелкоштучных грузов без тары в упаковке или в облегченной таре, так же личных вещей при переездах, различных товаров.'),
(5, 5, 'ru', '20 футовый контейнер - платформа', 'Данные контейнеры используются для перевозки негабаритных грузов и различной техники. Аналогично стандартным контейнерам, наиболее распространенными являются контейнера с размерами 20 и 40 футов.'),
(6, 6, 'ru', '40 футовый контейнер - платформа', 'Данные контейнеры используются для перевозки негабаритных грузов и различной техники. Аналогично стандартным контейнерам, наиболее распространенными являются контейнера с размерами 20 и 40 футов.'),
(7, 7, 'ru', '20/40 футовый контейнер - платформа', 'Данные контейнеры используются для перевозки негабаритных грузов и различной техники. Аналогично стандартным контейнерам, наиболее распространенными являются контейнера с размерами 20 и 40 футов.'),
(8, 8, 'ru', '20/40 футовый контейнер - платформа', 'Данные контейнеры используются для перевозки негабаритных грузов и различной техники. Аналогично стандартным контейнерам, наиболее распространенными являются контейнера с размерами 20 и 40 футов.'),
(9, 9, 'ru', '20 футовый контейнер с открытым верхом', 'Контейнера с открытым верхом не имеют жесткой металлической крыши. В 20 и 40 футовых контейнерах с открытым верхом предусмотрена возможность защиты от атмосферных осадков с помощью натяжных тентов. Перевозят в таких контейнерах негабаритный по высоте груз.'),
(10, 10, 'ru', '40 футовый контейнер с открытым верхом', 'Контейнера с открытым верхом не имеют жесткой металлической крыши. В 20 и 40 футовых контейнерах с открытым верхом предусмотрена возможность защиты от атмосферных осадков с помощью натяжных тентов. Перевозят в таких контейнерах негабаритный по высоте груз.'),
(11, 11, 'ru', '20-ти футовый рефрижераторный (стальной) контейнер', 'Рефрижераторные контейнеры применяются для перевозки и хранения продуктов, требующих определенной температурной обстановки. Идеальны для перевозки свежих продуктов, медицинских препаратов и других грузов, требующих холодильных условий, обеспечивают сохранность качества и безопасность перевозимых товаров.'),
(12, 12, 'ru', '40-ка футовый рефрижераторный (стальной) контейнер', 'Рефрижераторные контейнеры применяются для перевозки и хранения продуктов, требующих определенной температурной обстановки. Идеальны для перевозки свежих продуктов, медицинских препаратов и других грузов, требующих холодильных условий, обеспечивают сохранность качества и безопасность перевозимых товаров.'),
(13, 13, 'ru', '40-ка футовый high cube рефрижераторный (стальной) контейнер повышенной вместимости', 'Рефрижераторные контейнеры применяются для перевозки и хранения продуктов, требующих определенной температурной обстановки. Идеальны для перевозки свежих продуктов, медицинских препаратов и других грузов, требующих холодильных условий, обеспечивают сохранность качества и безопасность перевозимых товаров.'),
(14, 1, 'en', '20-foot container standard / high-cube', 'Used for transporting various unit loads, large cargo units, and small piece goods without packaging or in lightweight packaging. Also suitable for personal belongings during relocations and various merchandise.'),
(15, 2, 'en', '40-foot maritime container standard / high-cube', 'Used for transporting various unit loads, large cargo units, and small piece goods without packaging or in lightweight packaging. Also suitable for personal belongings during relocations and various merchandise.'),
(16, 3, 'en', '40-foot high-cube container', 'Used for transporting various unit loads, large cargo units, and small piece goods without packaging or in lightweight packaging. Also suitable for personal belongings during relocations and various merchandise.'),
(17, 4, 'en', '45-foot high-cube container', 'Used for transporting various unit loads, large cargo units, and small piece goods without packaging or in lightweight packaging. Also suitable for personal belongings during relocations and various merchandise.'),
(18, 5, 'en', '20-foot flat rack container', 'These containers are used for transporting oversized cargo and various equipment. Similar to standard containers, the most common sizes are 20 and 40-foot containers.'),
(19, 6, 'en', '40-foot flat rack container', 'These containers are used for transporting oversized cargo and various equipment. Similar to standard containers, the most common sizes are 20 and 40-foot containers.'),
(20, 7, 'en', '20/40-foot flat rack container', 'These containers are used for transporting oversized cargo and various equipment. Similar to standard containers, the most common sizes are 20 and 40-foot containers.'),
(21, 8, 'en', '20/40-foot flat rack container', 'These containers are used for transporting oversized cargo and various equipment. Similar to standard containers, the most common sizes are 20 and 40-foot containers.'),
(22, 9, 'en', '20-foot open-top container', 'Open-top containers do not have a rigid metal roof. In 20 and 40-foot open-top containers, it is possible to protect the cargo from atmospheric precipitation using tensioned tarpaulins. These containers are used for transporting oversized cargo that exceeds the height of standard containers.'),
(23, 10, 'en', '40-foot open-top container', 'Open-top containers do not have a rigid metal roof. In 20 and 40-foot open-top containers, it is possible to protect the cargo from atmospheric precipitation using tensioned tarpaulins. These containers are used for transporting oversized cargo that exceeds the height of standard containers.'),
(24, 11, 'en', '20-foot refrigerated (steel) container', 'Refrigerated containers are used for transporting and storing goods that require specific temperature conditions. Ideal for the transportation of fresh produce, medical supplies, and other cargoes requiring refrigeration, they ensure the preservation of quality and safety of the transported goods.'),
(25, 12, 'en', '40-foot refrigerated (steel) container', 'Refrigerated containers are used for transporting and storing goods that require specific temperature conditions. Ideal for the transportation of fresh produce, medical supplies, and other cargoes requiring refrigeration, they ensure the preservation of quality and safety of the transported goods.'),
(26, 13, 'en', '40-foot high cube refrigerated (steel) container', 'Refrigerated containers are used for transporting and storing goods that require specific temperature conditions. Ideal for the transportation of fresh produce, medical supplies, and other cargoes requiring refrigeration, they ensure the preservation of quality and safety of the transported goods.');
