(515, 529, 'services_translations', '1', '{\"title\": \"Морские контейнерные перевозки\", \"content\": \"<p>Долгосрочное партнерство с ведущими морскими перевозчиками позволяет нам предоставлять нашим клиентам лучшие тарифы на морские контейнерные перевозки и специальные условия в случае возникновения проблем. Мы поддерживаем сотрудничество с большинством мировых портов и, благодаря нашей глобальной агентской сети, оперативно информируем наших клиентов об изменениях в статусе и движении их грузов.</p>\\n<p>Наши услуги включают:</p>\\n<ul>\\n<li>Морские контейнерные перевозки: Независимо от типа контейнера, мы предоставляем доставку импортных и экспортных грузов.</li>\\n<li>Специализированная перевозка грузов: Мы осуществляем перевозку различных видов грузов, которые требуют особых условий транспортировки.</li>\\n<li>Гибкость в объеме груза: Мы принимаем грузы любого объема, гарантируя вашей компании надежное и удобное решение.</li>\\n<li>Наземная перевозка от/до порта: Мы предоставляем услуги &laquo;от двери до двери&raquo;, организуя наземную перевозку контейнеров с использованием автомобильного и железнодорожного транспорта.</li>\\n<li>Складские услуги: Мы предлагаем консолидацию, хранение и дистрибуцию грузов, а также другие складские услуги.</li>\\n<li>Документация: Мы заботимся о правильном и своевременном оформлении всех необходимых сопроводительных документов для вашей грузовой операции.</li>\\n<li>Страхование грузов: Мы предлагаем услуги страхования грузов, обеспечивая безопасность ваших товаров в процессе перевозки.</li>\\n<li>Сертификация и контроль: Мы предоставляем сюрвейерские услуги, обеспечивая надежное выполнение всех этапов перевозки.</li>\\n<li>Таможенные процедуры: Мы оказываем полный спектр таможенных услуг для облегчения импорта и экспорта грузов.</li>\\n</ul>\\n<p>С нами ваша компания получает все необходимые решения для успешных морских контейнерных перевозок.</p>\", \"services_id\": 1, \"short_title\": \"Морские\", \"languages_code\": {\"code\": \"ru\"}}', '{\"title\": \"Морские контейнерные перевозки\", \"content\": \"<p>Долгосрочное партнерство с ведущими морскими перевозчиками позволяет нам предоставлять нашим клиентам лучшие тарифы на морские контейнерные перевозки и специальные условия в случае возникновения проблем. Мы поддерживаем сотрудничество с большинством мировых портов и, благодаря нашей глобальной агентской сети, оперативно информируем наших клиентов об изменениях в статусе и движении их грузов.</p>\\n<p>Наши услуги включают:</p>\\n<ul>\\n<li>Морские контейнерные перевозки: Независимо от типа контейнера, мы предоставляем доставку импортных и экспортных грузов.</li>\\n<li>Специализированная перевозка грузов: Мы осуществляем перевозку различных видов грузов, которые требуют особых условий транспортировки.</li>\\n<li>Гибкость в объеме груза: Мы принимаем грузы любого объема, гарантируя вашей компании надежное и удобное решение.</li>\\n<li>Наземная перевозка от/до порта: Мы предоставляем услуги &laquo;от двери до двери&raquo;, организуя наземную перевозку контейнеров с использованием автомобильного и железнодорожного транспорта.</li>\\n<li>Складские услуги: Мы предлагаем консолидацию, хранение и дистрибуцию грузов, а также другие складские услуги.</li>\\n<li>Документация: Мы заботимся о правильном и своевременном оформлении всех необходимых сопроводительных документов для вашей грузовой операции.</li>\\n<li>Страхование грузов: Мы предлагаем услуги страхования грузов, обеспечивая безопасность ваших товаров в процессе перевозки.</li>\\n<li>Сертификация и контроль: Мы предоставляем сюрвейерские услуги, обеспечивая надежное выполнение всех этапов перевозки.</li>\\n<li>Таможенные процедуры: Мы оказываем полный спектр таможенных услуг для облегчения импорта и экспорта грузов.</li>\\n</ul>\\n<p>С нами ваша компания получает все необходимые решения для успешных морских контейнерных перевозок.</p>\", \"services_id\": 1, \"short_title\": \"Морские\", \"languages_code\": {\"code\": \"ru\"}}', 516, NULL),
