(735, 755, 'home_translations', '1', '{\"id\": 1, \"title\": \"Контейнерные перевозки\", \"content\": \"Предлагаем полный спектр транспортных услуг: контейнерные перевозки в порты Дальнего Востока, Санкт-Петербурга и Новороссийска, а также железнодорожные перевозки контейнеров из Китая в Россию. Помимо этого, мы осуществляем автомобильные и авиаперевозки грузов.\", \"home_id\": 1, \"advantage\": \"<p><span style=\\\"color: rgb(231, 237, 82);\\\">Эксперты в контейнерных перевозках</span> из Китая в Россию</p>\", \"slogan_p1\": \"Логистические решения\", \"slogan_p2\": \"для вашего бизнеса\", \"meta_title\": \"MLS — Логистические решения для вашего бизнеса, контейнерные перевозки из Китая в Россию\", \"languages_code\": \"ru\", \"meta_description\": \"описание на русском\", \"slogan_in_services\": \"Логистика без границ\", \"slogan_in_services_info\": \"Эксперты в логистике, готовы к любым вызовам рынка.\"}', '{\"home_id\": 1, \"languages_code\": \"ru\", \"slogan_in_services\": \"Логистика без границ\", \"slogan_in_services_info\": \"Эксперты в логистике, готовы к любым вызовам рынка.\"}', 736, NULL),
