(789, 811, 'services_translations', '1', '{\"id\": 1, \"title\": \"Морские контейнерные перевозки\", \"content\": \"<p>Долгосрочное партнерство с ведущими морскими перевозчиками позволяет нам предоставлять нашим клиентам лучшие тарифы на морские контейнерные перевозки и специальные условия в случае возникновения проблем. Мы поддерживаем сотрудничество с большинством мировых портов и, благодаря нашей глобальной агентской сети, оперативно информируем наших клиентов об изменениях в статусе и движении их грузов.</p>\\n<h3>Наши услуги включают:</h3>\\n<ul>\\n<li><strong>Морские контейнерные перевозки:</strong> Независимо от типа контейнера, мы предоставляем доставку импортных и экспортных грузов.</li>\\n<li><strong>Специализированная перевозка грузов: </strong>Мы осуществляем перевозку различных видов грузов, которые требуют особых условий транспортировки.</li>\\n<li><strong>Гибкость в объеме груза:</strong> Мы принимаем грузы любого объема, гарантируя вашей компании надежное и удобное решение.</li>\\n<li><strong>Наземная перевозка от/до порта:</strong> Мы предоставляем услуги &laquo;от двери до двери&raquo;, организуя наземную перевозку контейнеров с использованием автомобильного и железнодорожного транспорта.</li>\\n<li><strong>Складские услуги:</strong> Мы предлагаем консолидацию, хранение и дистрибуцию грузов, а также другие складские услуги.</li>\\n<li><strong>Документация:</strong> Мы заботимся о правильном и своевременном оформлении всех необходимых сопроводительных документов для вашей грузовой операции.</li>\\n<li><strong>Страхование грузов:</strong> Мы предлагаем услуги страхования грузов, обеспечивая безопасность ваших товаров в процессе перевозки.</li>\\n<li><strong>Сертификация и контроль:</strong> Мы предоставляем сюрвейерские услуги, обеспечивая надежное выполнение всех этапов перевозки.</li>\\n<li><strong>Таможенные процедуры:</strong> Мы оказываем полный спектр таможенных услуг для облегчения импорта и экспорта грузов.</li>\\n</ul>\\n<p>С нами ваша компания получает все необходимые решения для успешных морских контейнерных перевозок.</p>\", \"services_id\": 1, \"short_title\": \"Морские\", \"languages_code\": \"ru\"}', '{\"content\": \"<p>Долгосрочное партнерство с ведущими морскими перевозчиками позволяет нам предоставлять нашим клиентам лучшие тарифы на морские контейнерные перевозки и специальные условия в случае возникновения проблем. Мы поддерживаем сотрудничество с большинством мировых портов и, благодаря нашей глобальной агентской сети, оперативно информируем наших клиентов об изменениях в статусе и движении их грузов.</p>\\n<h3>Наши услуги включают:</h3>\\n<ul>\\n<li><strong>Морские контейнерные перевозки:</strong> Независимо от типа контейнера, мы предоставляем доставку импортных и экспортных грузов.</li>\\n<li><strong>Специализированная перевозка грузов: </strong>Мы осуществляем перевозку различных видов грузов, которые требуют особых условий транспортировки.</li>\\n<li><strong>Гибкость в объеме груза:</strong> Мы принимаем грузы любого объема, гарантируя вашей компании надежное и удобное решение.</li>\\n<li><strong>Наземная перевозка от/до порта:</strong> Мы предоставляем услуги &laquo;от двери до двери&raquo;, организуя наземную перевозку контейнеров с использованием автомобильного и железнодорожного транспорта.</li>\\n<li><strong>Складские услуги:</strong> Мы предлагаем консолидацию, хранение и дистрибуцию грузов, а также другие складские услуги.</li>\\n<li><strong>Документация:</strong> Мы заботимся о правильном и своевременном оформлении всех необходимых сопроводительных документов для вашей грузовой операции.</li>\\n<li><strong>Страхование грузов:</strong> Мы предлагаем услуги страхования грузов, обеспечивая безопасность ваших товаров в процессе перевозки.</li>\\n<li><strong>Сертификация и контроль:</strong> Мы предоставляем сюрвейерские услуги, обеспечивая надежное выполнение всех этапов перевозки.</li>\\n<li><strong>Таможенные процедуры:</strong> Мы оказываем полный спектр таможенных услуг для облегчения импорта и экспорта грузов.</li>\\n</ul>\\n<p>С нами ваша компания получает все необходимые решения для успешных морских контейнерных перевозок.</p>\", \"services_id\": \"1\", \"languages_code\": \"ru\"}', 790, NULL),
