(856, 878, 'reviews', '2', '{\"id\": 2, \"name\": \"Kate\", \"sort\": null, \"photo\": \"af3e9e29-8816-48b3-bd4f-03f8b07a45b2\", \"status\": \"published\", \"content\": \"I\'ve had a superb experience with this transport company! They\'re my top choice. Convenient location, impressive professionalism.\", \"language\": \"en\", \"date_created\": \"2024-01-04T11:58:47.000Z\", \"date_updated\": \"2024-01-05T18:42:39.000Z\", \"user_created\": \"48c92147-ac9c-4f45-946b-9f3f664dd223\", \"user_updated\": \"48c92147-ac9c-4f45-946b-9f3f664dd223\"}', '{\"language\": \"en\", \"date_updated\": \"2024-01-05T18:42:39.302Z\", \"user_updated\": \"48c92147-ac9c-4f45-946b-9f3f664dd223\"}', NULL, NULL),
