(858, 881, 'home_translations', '2', '{\"id\": 2, \"title\": \"Container shipping\", \"content\": \"We offer a full range of transportation services, including container shipping to the ports of the Russian Far East, St. Petersburg, and Novorossiysk, as well as railway transportation of containers from China to Russia. In addition, we provide trucking and air freight services for cargo.\", \"home_id\": 1, \"advantage\": \"<p><span style=\\\"color: rgb(231, 237, 82);\\\">Experts in container transportation</span> from China to Russia</p>\", \"slogan_p1\": \"Logistics solutions\", \"slogan_p2\": \"for your business\", \"meta_title\": \"MLS - Logistics Solutions for Your Business, Container Shipping from China to Russia.\", \"languages_code\": \"en\", \"meta_description\": \"MLS offers high-level logistics solutions for your business. Optimal container shipping from China to Russia. Ready to tackle your logistical challenges.\", \"slogan_in_services\": \"Logistics without borders\", \"slogan_in_services_info\": \"Logistics experts, ready for any challenges of the market.\"}', '{\"title\": \"Container shipping\", \"content\": \"We offer a full range of transportation services, including container shipping to the ports of the Russian Far East, St. Petersburg, and Novorossiysk, as well as railway transportation of containers from China to Russia. In addition, we provide trucking and air freight services for cargo.\", \"home_id\": 1, \"meta_title\": \"MLS - Logistics Solutions for Your Business, Container Shipping from China to Russia.\", \"languages_code\": \"en\", \"meta_description\": \"MLS offers high-level logistics solutions for your business. Optimal container shipping from China to Russia. Ready to tackle your logistical challenges.\", \"slogan_in_services_info\": \"Logistics experts, ready for any challenges of the market.\"}', 860, NULL);
