(877, 900, 'about_translations', '1', '{\"id\": 1, \"title\": \"О компании\", \"content\": \"<p>ООО &laquo;Мультимодальный логистический сервис&raquo; (MLS) &mdash; ваш надежный партнер в сфере транспортных услуг. Мы специализируемся на контейнерных перевозках, обеспечивая точность, эффективность и надежность в доставке. Наш опыт и актуальная информация о рынке позволяют нам предлагать лучшие логистические решения для вашего бизнеса. Сделайте логистику проще и выгоднее с MLS.</p>\\n<h2>Миссия MLS</h2>\\n<p>Нашей главной задачей является поддержка развития вашего бизнеса. Мы предлагаем эффективные логистические решения, сокращая ваши расходы и обеспечивая безопасную и своевременную доставку грузов.</p>\\n<h2>Преимущества сотрудничества с нами</h2>\\n<p>Сотрудничество с MLS &mdash; упрощение и оптимизация вашей логистики. Мы заботимся о каждой детали, чтобы ваша доставки стали более эффективными и выгодными.</p>\", \"about_id\": 1, \"meta_title\": \"О компании\", \"languages_code\": \"ru\", \"meta_description\": \"MLS — ваш надежный партнер в сфере транспортных услуг. Мы специализируемся на контейнерных перевозках, обеспечивая точность, эффективность и надежность в доставке.\"}', '{\"about_id\": 1, \"languages_code\": \"ru\", \"meta_description\": \"MLS — ваш надежный партнер в сфере транспортных услуг. Мы специализируемся на контейнерных перевозках, обеспечивая точность, эффективность и надежность в доставке.\"}', 878, NULL),
