(879, 902, 'about_translations', '2', '{\"id\": 2, \"title\": \"About\", \"content\": \"<p>Multimodal Logistics Service LLC (MLS) is your reliable partner in the field of transportation services. We specialize in container transportation, ensuring accuracy, efficiency, and reliability in delivery. Our experience and up-to-date market information enable us to offer the best logistics solutions for your business. Simplify and make logistics more profitable with MLS.</p>\\n<h2>Mission of MLS</h2>\\n<p>Our main objective is to support the development of your business. We offer efficient logistics solutions, reducing your costs and ensuring safe and timely delivery of goods.</p>\\n<h2>The advantages of partnering with us</h2>\\n<p>Collaborating with MLS means simplifying and optimizing your logistics. We take care of every detail to make your deliveries more efficient and cost-effective.</p>\", \"about_id\": 1, \"meta_title\": \"About\", \"languages_code\": \"en\", \"meta_description\": \"d\"}', '{\"content\": \"<p>Multimodal Logistics Service LLC (MLS) is your reliable partner in the field of transportation services. We specialize in container transportation, ensuring accuracy, efficiency, and reliability in delivery. Our experience and up-to-date market information enable us to offer the best logistics solutions for your business. Simplify and make logistics more profitable with MLS.</p>\\n<h2>Mission of MLS</h2>\\n<p>Our main objective is to support the development of your business. We offer efficient logistics solutions, reducing your costs and ensuring safe and timely delivery of goods.</p>\\n<h2>The advantages of partnering with us</h2>\\n<p>Collaborating with MLS means simplifying and optimizing your logistics. We take care of every detail to make your deliveries more efficient and cost-effective.</p>\", \"about_id\": 1, \"languages_code\": \"en\"}', 880, NULL),
