(1290, 1320, 'news_translations', '2', '{\"title\": \"Контейнеры становятся дешевле\", \"content\": \"<p>Средние цены на контейнеры снизились более чем наполовину по сравнению с августом прошлого года, поскольку Китай в последнее время набирает объемы контейнерной торговли, согласно анализу, опубликованному платформой Container xChange:</p>\\n<p>&laquo;Сейчас пик сезона морских перевозок, и отрасль ожидает интенсивного оттока контейнеров из Китая для выполнения заказов из центров спроса. В этом году мы не наблюдали двух ключевых тенденций, которые были нормой в это время в предыдущие годы - роста арендных ставок и цен на контейнеры в Китае и снижения стоимости Шанхайского индекса доступности контейнеров (CAx)&raquo;</p>\\n<p>В своем анализе они подчеркивают, что индекс CAx растет от недели к неделе и значительно превышает уровни 2020 и 2019 годов. По мнению Container xChange, это потенциально может означать, что в Китае больше контейнеров по сниженным ценам, что облегчает грузоотправителям и экспедиторам планирование перевозок из Китая.</p>\\n<p>Также они отмечают снижение на 17% ставок аренды контейнеров в одну сторону из Китая в США с июня по июль. Кроме того, цена стандартного контейнера, по их данным, упала вдвое по сравнению с августом 2021 года и настоящим временем.&nbsp;</p>\\n<p>&laquo;Снижение средних цен на контейнеры и ставок аренды открывает хорошие возможности для грузоотправителей и экспедиторских компаний, поскольку цепочка поставок готовится к пиковому сезону, который обычно длится с июля по сентябрь&raquo;</p>\", \"news_id\": 2, \"languages_code\": {\"code\": \"ru\"}}', '{\"title\": \"Контейнеры становятся дешевле\", \"content\": \"<p>Средние цены на контейнеры снизились более чем наполовину по сравнению с августом прошлого года, поскольку Китай в последнее время набирает объемы контейнерной торговли, согласно анализу, опубликованному платформой Container xChange:</p>\\n<p>&laquo;Сейчас пик сезона морских перевозок, и отрасль ожидает интенсивного оттока контейнеров из Китая для выполнения заказов из центров спроса. В этом году мы не наблюдали двух ключевых тенденций, которые были нормой в это время в предыдущие годы - роста арендных ставок и цен на контейнеры в Китае и снижения стоимости Шанхайского индекса доступности контейнеров (CAx)&raquo;</p>\\n<p>В своем анализе они подчеркивают, что индекс CAx растет от недели к неделе и значительно превышает уровни 2020 и 2019 годов. По мнению Container xChange, это потенциально может означать, что в Китае больше контейнеров по сниженным ценам, что облегчает грузоотправителям и экспедиторам планирование перевозок из Китая.</p>\\n<p>Также они отмечают снижение на 17% ставок аренды контейнеров в одну сторону из Китая в США с июня по июль. Кроме того, цена стандартного контейнера, по их данным, упала вдвое по сравнению с августом 2021 года и настоящим временем.&nbsp;</p>\\n<p>&laquo;Снижение средних цен на контейнеры и ставок аренды открывает хорошие возможности для грузоотправителей и экспедиторских компаний, поскольку цепочка поставок готовится к пиковому сезону, который обычно длится с июля по сентябрь&raquo;</p>\", \"news_id\": 2, \"languages_code\": {\"code\": \"ru\"}}', 1291, NULL),
