[{\"title\": \"Контейнеры становятся дешевле\", \"content\": \"<p>Средние цены на контейнеры снизились более чем наполовину по сравнению с августом прошлого года, поскольку Китай в последнее время набирает объемы контейнерной торговли, согласно анализу, опубликованному платформой Container xChange:</p>\\n<p>&laquo;Сейчас пик сезона морских перевозок, и отрасль ожидает интенсивного оттока контейнеров из Китая для выполнения заказов из центров спроса. В этом году мы не наблюдали двух ключевых тенденций, которые были нормой в это время в предыдущие годы - роста арендных ставок и цен на контейнеры в Китае и снижения стоимости Шанхайского индекса доступности контейнеров (CAx)&raquo;</p>\\n<p>В своем анализе они подчеркивают, что индекс CAx растет от недели к неделе и значительно превышает уровни 2020 и 2019 годов. По мнению Container xChange, это потенциально может означать, что в Китае больше контейнеров по сниженным ценам, что облегчает грузоотправителям и экспедиторам планирование перевозок из Китая.</p>\\n<p>Также они отмечают снижение на 17% ставок аренды контейнеров в одну сторону из Китая в США с июня по июль. Кроме того, цена стандартного контейнера, по их данным, упала вдвое по сравнению с августом 2021 года и настоящим временем.&nbsp;</p>\\n<p>&laquo;Снижение средних цен на контейнеры и ставок аренды открывает хорошие возможности для грузоотправителей и экспедиторских компаний, поскольку цепочка поставок готовится к пиковому сезону, который обычно длится с июля по сентябрь&raquo;</p>\", \"languages_code\": {\"code\": \"ru\"}}], \"delete\": [], \"update\": []}}', NULL, NULL),
(1292, 1322, 'news_translations', '3', '{\"title\": \"Containers are becoming cheaper\", \"content\": \"<p>Average prices for containers have decreased by more than half compared to August of last year, as China is currently ramping up container trade volumes, according to an analysis published by the Container xChange platform.</p>\\n<p>\\\"It is currently the peak season for maritime transport, and the industry anticipates a significant outflow of containers from China to fulfill orders from demand centers. This year, we have not observed two key trends that were the norm at this time in previous years - an increase in lease rates and container prices in China and a decrease in the cost of the Shanghai Container Availability Index (CAx).\\\"</p>\\n<p>In their analysis, they emphasize that the CAx index is growing from week to week and significantly exceeds the levels of 2020 and 2019. According to Container xChange, this potentially indicates that there are more containers in China at reduced prices, making it easier for shippers and forwarders to plan shipments from China.</p>\\n<p>They also note a 17% decrease in one-way container rental rates from China to the United States from June to July. Additionally, the price of a standard container, according to their data, has halved compared to August 2021 and the present time.</p>\\n<p>\\\"The decline in average container prices and rental rates opens up good opportunities for shippers and forwarding companies as the supply chain prepares for the peak season, which typically lasts from July to September.\\\"</p>\", \"news_id\": \"2\", \"languages_code\": {\"code\": \"en\"}}', '{\"title\": \"Containers are becoming cheaper\", \"content\": \"<p>Average prices for containers have decreased by more than half compared to August of last year, as China is currently ramping up container trade volumes, according to an analysis published by the Container xChange platform.</p>\\n<p>\\\"It is currently the peak season for maritime transport, and the industry anticipates a significant outflow of containers from China to fulfill orders from demand centers. This year, we have not observed two key trends that were the norm at this time in previous years - an increase in lease rates and container prices in China and a decrease in the cost of the Shanghai Container Availability Index (CAx).\\\"</p>\\n<p>In their analysis, they emphasize that the CAx index is growing from week to week and significantly exceeds the levels of 2020 and 2019. According to Container xChange, this potentially indicates that there are more containers in China at reduced prices, making it easier for shippers and forwarders to plan shipments from China.</p>\\n<p>They also note a 17% decrease in one-way container rental rates from China to the United States from June to July. Additionally, the price of a standard container, according to their data, has halved compared to August 2021 and the present time.</p>\\n<p>\\\"The decline in average container prices and rental rates opens up good opportunities for shippers and forwarding companies as the supply chain prepares for the peak season, which typically lasts from July to September.\\\"</p>\", \"news_id\": \"2\", \"languages_code\": {\"code\": \"en\"}}', 1293, NULL),
(1293, 1323, 'news', '2', '{\"id\": 2, \"slug\": \"29-08-2022-01\", \"sort\": null, \"image\": \"6d62ed2e-0c01-454d-954d-8791a092e108\", \"status\": \"published\", \"date_created\": \"2024-01-07T08:58:00.000Z\", \"date_updated\": \"2024-01-07T09:14:14.000Z\", \"translations\": [2, 3], \"user_created\": \"48c92147-ac9c-4f45-946b-9f3f664dd223\", \"user_updated\": \"48c92147-ac9c-4f45-946b-9f3f664dd223\"}', '{\"date_updated\": \"2024-01-07T09:14:14.148Z\", \"user_updated\": \"48c92147-ac9c-4f45-946b-9f3f664dd223\"}', NULL, NULL),
(1294, 1324, 'news_translations', '4', '{\"title\": \"Container lines are gearing up for a slowdown in growth as freight rates decrease\", \"content\": \"<p>Recently, we have witnessed the most profitable period in the history of container shipping, but our industry is accustomed to cycles of booms and downturns, so the situation can always change.</p>\\n<p>Last week, the World Trade Organization announced that trade flows slowed in the last quarter and are likely to remain weak in the second half of the year. This still aligns with the WTO\'s forecast of a 3% growth in global goods trade in 2022.</p>\\n<p>However, the organization expressed less confidence in this forecast, considering that geopolitical tensions persist, inflationary pressure remains, and interest rates are rising.</p>\\n<p>The good news is that some supply chain issues are easing, and fuel prices are falling, alleviating some of the logistical cost challenges that impacted companies\' balances. But it also means that the unexpected surge in profitability caused by the pandemic is fading.</p>\\n<p>Also last week, Citi analysts reduced ratings forecasts for Maersk, Hapag-Lloyd, and Zim, expecting a deeper slowdown in global demand, citing several reasons: reduced consumption, declining home sales in the United States, and rising inflation. All of these are negative signs for an industry that accounts for about 80% of global trade.</p>\\n<p>Currently, carriers, who just a few months ago had zero spare capacity, are offering enough space on ships they deploy on key trade routes, leading to a decline in short-term container shipping rates for six consecutive months.</p>\\n<p>Last Wednesday, Drewry reported that the spot rate on the benchmark route from Asia to the U.S. dropped to $4949 for a 40-foot container, falling below $5000 for the first time since December 2020.</p>\\n<p>Clarksons Research expects that in 2022, container shipping capacity will exceed demand by 300 basis points, leading to further reductions in container rates.</p>\\n<p>Spot rates for container shipping are expected to continue to decrease but will remain \\\"significantly higher\\\" than their pre-pandemic levels until the end of 2022 due to the lingering fragility of global supply chains.</p>\", \"news_id\": \"1\", \"languages_code\": {\"code\": \"en\"}}', '{\"title\": \"Container lines are gearing up for a slowdown in growth as freight rates decrease\", \"content\": \"<p>Recently, we have witnessed the most profitable period in the history of container shipping, but our industry is accustomed to cycles of booms and downturns, so the situation can always change.</p>\\n<p>Last week, the World Trade Organization announced that trade flows slowed in the last quarter and are likely to remain weak in the second half of the year. This still aligns with the WTO\'s forecast of a 3% growth in global goods trade in 2022.</p>\\n<p>However, the organization expressed less confidence in this forecast, considering that geopolitical tensions persist, inflationary pressure remains, and interest rates are rising.</p>\\n<p>The good news is that some supply chain issues are easing, and fuel prices are falling, alleviating some of the logistical cost challenges that impacted companies\' balances. But it also means that the unexpected surge in profitability caused by the pandemic is fading.</p>\\n<p>Also last week, Citi analysts reduced ratings forecasts for Maersk, Hapag-Lloyd, and Zim, expecting a deeper slowdown in global demand, citing several reasons: reduced consumption, declining home sales in the United States, and rising inflation. All of these are negative signs for an industry that accounts for about 80% of global trade.</p>\\n<p>Currently, carriers, who just a few months ago had zero spare capacity, are offering enough space on ships they deploy on key trade routes, leading to a decline in short-term container shipping rates for six consecutive months.</p>\\n<p>Last Wednesday, Drewry reported that the spot rate on the benchmark route from Asia to the U.S. dropped to $4949 for a 40-foot container, falling below $5000 for the first time since December 2020.</p>\\n<p>Clarksons Research expects that in 2022, container shipping capacity will exceed demand by 300 basis points, leading to further reductions in container rates.</p>\\n<p>Spot rates for container shipping are expected to continue to decrease but will remain \\\"significantly higher\\\" than their pre-pandemic levels until the end of 2022 due to the lingering fragility of global supply chains.</p>\", \"news_id\": \"1\", \"languages_code\": {\"code\": \"en\"}}', 1295, NULL),
(1295, 1325, 'news', '1', '{\"id\": 1, \"slug\": \"31-08-2022-01\", \"sort\": null, \"image\": \"f936ac9f-d236-4518-9487-8de686f0e281\", \"status\": \"published\", \"date_created\": \"2022-08-31T08:46:00.000Z\", \"date_updated\": \"2024-01-07T09:15:13.000Z\", \"translations\": [1, 4], \"user_created\": \"48c92147-ac9c-4f45-946b-9f3f664dd223\", \"user_updated\": \"48c92147-ac9c-4f45-946b-9f3f664dd223\"}', '{\"date_updated\": \"2024-01-07T09:15:12.998Z\", \"user_updated\": \"48c92147-ac9c-4f45-946b-9f3f664dd223\"}', NULL, NULL),
