(1297, 1329, 'news_translations', '5', '{\"title\": \"Контейнерные линии готовятся к замедлению темпов роста, поскольку ставки фрахта снижаются\", \"content\": \"<div>\\n<div>\\n<div>\\n<div data-customstyle=\\\"yes\\\">Последнее время мы наблюдаем самый прибыльный период в истории контейнерных перевозок, но наша отрасль привыкла к циклам бумов и спадов, поэтому ситуация всегда может измениться.</div>\\n<div data-customstyle=\\\"yes\\\">&nbsp;</div>\\n<div data-customstyle=\\\"yes\\\">На прошлой неделе Всемирная торговая организация заявила, что торговые потоки замедлились в прошлом квартале и, скорее всего, останутся слабыми во второй половине года. Это все еще соответствует прогнозу ВТО о 3% росте мировой торговли товарами в 2022 году.</div>\\n<div data-customstyle=\\\"yes\\\">&nbsp;</div>\\n<div data-customstyle=\\\"yes\\\">Однако организация выразила меньшую уверенность в этом прогнозе, учитывая, что геополитическая напряженность затягивается, инфляционное давление сохраняется, а процентные ставки растут.</div>\\n<div data-customstyle=\\\"yes\\\">&nbsp;</div>\\n<div data-customstyle=\\\"yes\\\">Хорошая новость заключается в том, что некоторые проблемы с поставками ослабевают, а цены на топливо падают, что снимает некоторые сложности, связанные с логистическими расходами, которые влияли на балансы компаний. Но это также означает, что неожиданный всплеск прибыльности, вызванный пандемией, проходит.</div>\\n<div data-customstyle=\\\"yes\\\">&nbsp;</div>\\n<div data-customstyle=\\\"yes\\\">Также на прошлой неделе аналитики Citi сократили прогноз по рейтингам Maersk, Hapag-Lloyd и Zim, ожидая более глубокого замедления мирового спроса, ссылаясь на несколько причин: сокращение потребления, снижение продаж домов в США и рост инфляции. Все это негативные предзнаменования для отрасли, которая обеспечивает около 80% мировой торговли.</div>\\n<div data-customstyle=\\\"yes\\\">&nbsp;</div>\\n<div data-customstyle=\\\"yes\\\">Сейчас перевозчики, которые всего несколько месяцев назад имели нулевые свободные мощности, предлагают достаточно мест на судах, которые они размещают на ключевых торговых маршрутах, что привело к снижению краткосрочных ставок на контейнерные перевозки в течение шести месяцев подряд.</div>\\n<div data-customstyle=\\\"yes\\\">&nbsp;</div>\\n<div data-customstyle=\\\"yes\\\">В прошлую среду компания Drewry сообщила, что спотовая ставка на эталонном маршруте из Азии в США упала до $4949 за 40-футовый контейнер, впервые с декабря 2020 года опустившись ниже $5000.</div>\\n<div data-customstyle=\\\"yes\\\">&nbsp;</div>\\n<div data-customstyle=\\\"yes\\\">Компания Clarksons Research ожидает, что в 2022 году мощности контейнерной торговли будут опережать спрос на 300 базисных пунктов, что может привести к дальнейшему снижению контейнерных ставок.</div>\\n<div data-customstyle=\\\"yes\\\">&nbsp;</div>\\n<div data-customstyle=\\\"yes\\\">Ожидается, что спотовые ставки на контейнерные перевозки продолжат снижаться, но останутся &laquo;значительно выше&raquo; своих допандемических уровней до конца 2022 года из-за сохраняющейся хрупкости мировых цепей поставок</div>\\n</div>\\n</div>\\n</div>\", \"news_id\": 3, \"languages_code\": {\"code\": \"ru\"}}', '{\"title\": \"Контейнерные линии готовятся к замедлению темпов роста, поскольку ставки фрахта снижаются\", \"content\": \"<div>\\n<div>\\n<div>\\n<div data-customstyle=\\\"yes\\\">Последнее время мы наблюдаем самый прибыльный период в истории контейнерных перевозок, но наша отрасль привыкла к циклам бумов и спадов, поэтому ситуация всегда может измениться.</div>\\n<div data-customstyle=\\\"yes\\\">&nbsp;</div>\\n<div data-customstyle=\\\"yes\\\">На прошлой неделе Всемирная торговая организация заявила, что торговые потоки замедлились в прошлом квартале и, скорее всего, останутся слабыми во второй половине года. Это все еще соответствует прогнозу ВТО о 3% росте мировой торговли товарами в 2022 году.</div>\\n<div data-customstyle=\\\"yes\\\">&nbsp;</div>\\n<div data-customstyle=\\\"yes\\\">Однако организация выразила меньшую уверенность в этом прогнозе, учитывая, что геополитическая напряженность затягивается, инфляционное давление сохраняется, а процентные ставки растут.</div>\\n<div data-customstyle=\\\"yes\\\">&nbsp;</div>\\n<div data-customstyle=\\\"yes\\\">Хорошая новость заключается в том, что некоторые проблемы с поставками ослабевают, а цены на топливо падают, что снимает некоторые сложности, связанные с логистическими расходами, которые влияли на балансы компаний. Но это также означает, что неожиданный всплеск прибыльности, вызванный пандемией, проходит.</div>\\n<div data-customstyle=\\\"yes\\\">&nbsp;</div>\\n<div data-customstyle=\\\"yes\\\">Также на прошлой неделе аналитики Citi сократили прогноз по рейтингам Maersk, Hapag-Lloyd и Zim, ожидая более глубокого замедления мирового спроса, ссылаясь на несколько причин: сокращение потребления, снижение продаж домов в США и рост инфляции. Все это негативные предзнаменования для отрасли, которая обеспечивает около 80% мировой торговли.</div>\\n<div data-customstyle=\\\"yes\\\">&nbsp;</div>\\n<div data-customstyle=\\\"yes\\\">Сейчас перевозчики, которые всего несколько месяцев назад имели нулевые свободные мощности, предлагают достаточно мест на судах, которые они размещают на ключевых торговых маршрутах, что привело к снижению краткосрочных ставок на контейнерные перевозки в течение шести месяцев подряд.</div>\\n<div data-customstyle=\\\"yes\\\">&nbsp;</div>\\n<div data-customstyle=\\\"yes\\\">В прошлую среду компания Drewry сообщила, что спотовая ставка на эталонном маршруте из Азии в США упала до $4949 за 40-футовый контейнер, впервые с декабря 2020 года опустившись ниже $5000.</div>\\n<div data-customstyle=\\\"yes\\\">&nbsp;</div>\\n<div data-customstyle=\\\"yes\\\">Компания Clarksons Research ожидает, что в 2022 году мощности контейнерной торговли будут опережать спрос на 300 базисных пунктов, что может привести к дальнейшему снижению контейнерных ставок.</div>\\n<div data-customstyle=\\\"yes\\\">&nbsp;</div>\\n<div data-customstyle=\\\"yes\\\">Ожидается, что спотовые ставки на контейнерные перевозки продолжат снижаться, но останутся &laquo;значительно выше&raquo; своих допандемических уровней до конца 2022 года из-за сохраняющейся хрупкости мировых цепей поставок</div>\\n</div>\\n</div>\\n</div>\", \"news_id\": 3, \"languages_code\": {\"code\": \"ru\"}}', 1298, NULL);
