шись ниже $5000.</div>\\n<div data-customstyle=\\\"yes\\\">&nbsp;</div>\\n<div data-customstyle=\\\"yes\\\">Компания Clarksons Research ожидает, что в 2022 году мощности контейнерной торговли будут опережать спрос на 300 базисных пунктов, что может привести к дальнейшему снижению контейнерных ставок.</div>\\n<div data-customstyle=\\\"yes\\\">&nbsp;</div>\\n<div data-customstyle=\\\"yes\\\">Ожидается, что спотовые ставки на контейнерные перевозки продолжат снижаться, но останутся &laquo;значительно выше&raquo; своих допандемических уровней до конца 2022 года из-за сохраняющейся хрупкости мировых цепей поставок</div>\\n</div>\\n</div>\\n</div>\", \"languages_code\": {\"code\": \"ru\"}}], \"delete\": [], \"update\": []}}', NULL, NULL),
(1299, 1331, 'news_translations', '6', '{\"title\": \"Container lines are preparing for a slowdown in growth as freight rates decrease\", \"content\": \"<p>Recently, we have witnessed the most profitable period in the history of container shipping. However, our industry is accustomed to cycles of booms and downturns, so the situation can always change.</p>\\n<p>Last week, the World Trade Organization stated that trade flows slowed in the last quarter and are likely to remain weak in the second half of the year. This still aligns with the WTO\'s forecast of a 3% growth in global goods trade in 2022.</p>\\n<p>However, the organization expressed less confidence in this forecast, considering that geopolitical tensions persist, inflationary pressure remains, and interest rates are rising.</p>\\n<p>The good news is that some supply chain issues are easing, and fuel prices are dropping, alleviating some of the logistical cost challenges that affected company balances. But it also means that the unexpected profitability surge caused by the pandemic is fading.</p>\\n<p>Last week, Citi analysts lowered their ratings forecasts for Maersk, Hapag-Lloyd, and Zim, expecting a deeper slowdown in global demand, citing several reasons: reduced consumption, declining home sales in the United States, and inflationary growth. All of these are negative omens for an industry that facilitates about 80% of global trade.</p>\\n<p>Now carriers, who just a few months ago had zero idle capacity, are offering enough space on ships that they deploy on key trade routes, leading to a decline in short-term container shipping rates for six consecutive months.</p>\\n<p>Last Wednesday, Drewry reported that the spot rate on the benchmark route from Asia to the U.S. fell to $4949 for a 40-foot container, dropping below $5000 for the first time since December 2020.</p>\\n<p>Clarksons Research expects container shipping capacity to outpace demand by 300 basis points in 2022, which could lead to further reductions in container rates.</p>\\n<p>Spot rates for container shipping are expected to continue to decline but will remain \\\"significantly higher\\\" than their pre-pandemic levels until the end of 2022 due to the continued fragility of global supply chains.</p>\", \"news_id\": \"3\", \"languages_code\": {\"code\": \"en\"}}', '{\"title\": \"Container lines are preparing for a slowdown in growth as freight rates decrease\", \"content\": \"<p>Recently, we have witnessed the most profitable period in the history of container shipping. However, our industry is accustomed to cycles of booms and downturns, so the situation can always change.</p>\\n<p>Last week, the World Trade Organization stated that trade flows slowed in the last quarter and are likely to remain weak in the second half of the year. This still aligns with the WTO\'s forecast of a 3% growth in global goods trade in 2022.</p>\\n<p>However, the organization expressed less confidence in this forecast, considering that geopolitical tensions persist, inflationary pressure remains, and interest rates are rising.</p>\\n<p>The good news is that some supply chain issues are easing, and fuel prices are dropping, alleviating some of the logistical cost challenges that affected company balances. But it also means that the unexpected profitability surge caused by the pandemic is fading.</p>\\n<p>Last week, Citi analysts lowered their ratings forecasts for Maersk, Hapag-Lloyd, and Zim, expecting a deeper slowdown in global demand, citing several reasons: reduced consumption, declining home sales in the United States, and inflationary growth. All of these are negative omens for an industry that facilitates about 80% of global trade.</p>\\n<p>Now carriers, who just a few months ago had zero idle capacity, are offering enough space on ships that they deploy on key trade routes, leading to a decline in short-term container shipping rates for six consecutive months.</p>\\n<p>Last Wednesday, Drewry reported that the spot rate on the benchmark route from Asia to the U.S. fell to $4949 for a 40-foot container, dropping below $5000 for the first time since December 2020.</p>\\n<p>Clarksons Research expects container shipping capacity to outpace demand by 300 basis points in 2022, which could lead to further reductions in container rates.</p>\\n<p>Spot rates for container shipping are expected to continue to decline but will remain \\\"significantly higher\\\" than their pre-pandemic levels until the end of 2022 due to the continued fragility of global supply chains.</p>\", \"news_id\": \"3\", \"languages_code\": {\"code\": \"en\"}}', 1300, NULL),
(1300, 1332, 'news', '3', '{\"id\": 3, \"sort\": null, \"image\": \"f936ac9f-d236-4518-9487-8de686f0e281\", \"status\": \"published\", \"date_created\": \"2024-01-07T12:28:08.000Z\", \"date_updated\": \"2024-01-07T12:30:23.000Z\", \"translations\": [5, 6], \"user_created\": \"48c92147-ac9c-4f45-946b-9f3f664dd223\", \"user_updated\": \"48c92147-ac9c-4f45-946b-9f3f664dd223\"}', '{\"date_updated\": \"2024-01-07T12:30:22.677Z\", \"user_updated\": \"48c92147-ac9c-4f45-946b-9f3f664dd223\"}', NULL, NULL),
(1301, 1334, 'news_translations', '7', '{\"title\": \"Контейнеры становятся дешевле\", \"content\": \"<p>Средние цены на контейнеры снизились более чем наполовину по сравнению с августом прошлого года, поскольку Китай в последнее время набирает объемы контейнерной торговли, согласно анализу, опубликованному платформой Container xChange:</p>\\n<p>&laquo;Сейчас пик сезона морских перевозок, и отрасль ожидает интенсивного оттока контейнеров из Китая для выполнения заказов из центров спроса. В этом году мы не наблюдали двух ключевых тенденций, которые были нормой в это время в предыдущие годы - роста арендных ставок и цен на контейнеры в Китае и снижения стоимости Шанхайского индекса доступности контейнеров (CAx)&raquo;</p>\\n<p>В своем анализе они подчеркивают, что индекс CAx растет от недели к неделе и значительно превышает уровни 2020 и 2019 годов. По мнению Container xChange, это потенциально может означать, что в Китае больше контейнеров по сниженным ценам, что облегчает грузоотправителям и экспедиторам планирование перевозок из Китая.</p>\\n<p>Также они отмечают снижение на 17% ставок аренды контейнеров в одну сторону из Китая в США с июня по июль. Кроме того, цена стандартного контейнера, по их данным, упала вдвое по сравнению с августом 2021 года и настоящим временем.</p>\\n<p>&laquo;Снижение средних цен на контейнеры и ставок аренды открывает хорошие возможности для грузоотправителей и экспедиторских компаний, поскольку цепочка поставок готовится к пиковому сезону, который обычно длится с июля по сентябрь&raquo;</p>\", \"news_id\": 4, \"languages_code\": {\"code\": \"ru\"}}', '{\"title\": \"Контейнеры становятся дешевле\", \"content\": \"<p>Средние цены на контейнеры снизились более чем наполовину по сравнению с августом прошлого года, поскольку Китай в последнее время набирает объемы контейнерной торговли, согласно анализу, опубликованному платформой Container xChange:</p>\\n<p>&laquo;Сейчас пик сезона морских перевозок, и отрасль ожидает интенсивного оттока контейнеров из Китая для выполнения заказов из центров спроса. В этом году мы не наблюдали двух ключевых тенденций, которые были нормой в это время в предыдущие годы - роста арендных ставок и цен на контейнеры в Китае и снижения стоимости Шанхайского индекса доступности контейнеров (CAx)&raquo;</p>\\n<p>В своем анализе они подчеркивают, что индекс CAx растет от недели к неделе и значительно превышает уровни 2020 и 2019 годов. По мнению Container xChange, это потенциально может означать, что в Китае больше контейнеров по сниженным ценам, что облегчает грузоотправителям и экспедиторам планирование перевозок из Китая.</p>\\n<p>Также они отмечают снижение на 17% ставок аренды контейнеров в одну сторону из Китая в США с июня по июль. Кроме того, цена стандартного контейнера, по их данным, упала вдвое по сравнению с августом 2021 года и настоящим временем.</p>\\n<p>&laquo;Снижение средних цен на контейнеры и ставок аренды открывает хорошие возможности для грузоотправителей и экспедиторских компаний, поскольку цепочка поставок готовится к пиковому сезону, который обычно длится с июля по сентябрь&raquo;</p>\", \"news_id\": 4, \"languages_code\": {\"code\": \"ru\"}}', 1303, NULL),
(1302, 1335, 'news_translations', '8', '{\"title\": \"Containers are becoming cheaper\", \"content\": \"<p>Average prices for containers have decreased by more than half compared to August of last year as China is currently ramping up container trade volumes, according to an analysis published by the Container xChange platform:</p>\\n<p>\\\"Now is the peak season for maritime shipments, and the industry anticipates a significant outflow of containers from China to fulfill orders from demand centers. This year, we have not observed two key trends that were the norm at this time in previous years - an increase in rental rates and container prices in China and a decrease in the cost of the Shanghai Container Availability Index (CAx).\\\"</p>\\n<p>In their analysis, they emphasize that the CAx index is growing from week to week and significantly surpasses the levels of 2020 and 2019. According to Container xChange, this could potentially mean that there are more containers in China at reduced prices, making it easier for shippers and freight forwarders to plan shipments from China.</p>\\n<p>They also note a 17% decrease in one-way container rental rates from China to the U.S. from June to July. Additionally, the price of a standard container, according to their data, has halved compared to August 2021 and the present time.</p>\\n<p>\\\"The decrease in average container prices and rental rates opens up good opportunities for shippers and freight forwarding companies as the supply chain prepares for the peak season, which typically lasts from July to September.\\\"</p>\", \"news_id\": 4, \"languages_code\": {\"code\": \"en\"}}', '{\"title\": \"Containers are becoming cheaper\", \"content\": \"<p>Average prices for containers have decreased by more than half compared to August of last year as China is currently ramping up container trade volumes, according to an analysis published by the Container xChange platform:</p>\\n<p>\\\"Now is the peak season for maritime shipments, and the industry anticipates a significant outflow of containers from China to fulfill orders from demand centers. This year, we have not observed two key trends that were the norm at this time in previous years - an increase in rental rates and container prices in China and a decrease in the cost of the Shanghai Container Availability Index (CAx).\\\"</p>\\n<p>In their analysis, they emphasize that the CAx index is growing from week to week and significantly surpasses the levels of 2020 and 2019. According to Container xChange, this could potentially mean that there are more containers in China at reduced prices, making it easier for shippers and freight forwarders to plan shipments from China.</p>\\n<p>They also note a 17% decrease in one-way container rental rates from China to the U.S. from June to July. Additionally, the price of a standard container, according to their data, has halved compared to August 2021 and the present time.</p>\\n<p>\\\"The decrease in average container prices and rental rates opens up good opportunities for shippers and freight forwarding companies as the supply chain prepares for the peak season, which typically lasts from July to September.\\\"</p>\", \"news_id\": 4, \"languages_code\": {\"code\": \"en\"}}', 1303, NULL),
