(1304, 1337, 'news', '3', '{\"id\": 3, \"sort\": null, \"image\": \"f936ac9f-d236-4518-9487-8de686f0e281\", \"status\": \"published\", \"date_created\": \"2020-08-31T12:28:00.000Z\", \"date_updated\": \"2024-01-07T12:42:26.000Z\", \"translations\": [5, 6], \"user_created\": \"48c92147-ac9c-4f45-946b-9f3f664dd223\", \"user_updated\": \"48c92147-ac9c-4f45-946b-9f3f664dd223\"}', '{\"date_created\": \"2020-08-31T12:28:00.000Z\", \"date_updated\": \"2024-01-07T12:42:25.970Z\", \"user_updated\": \"48c92147-ac9c-4f45-946b-9f3f664dd223\"}', NULL, NULL),
(1305, 1338, 'news', '4', '{\"id\": 4, \"sort\": null, \"image\": \"6d62ed2e-0c01-454d-954d-8791a092e108\", \"status\": \"published\", \"date_created\": \"2022-08-29T12:41:00.000Z\", \"date_updated\": \"2024-01-07T12:42:41.000Z\", \"translations\": [7, 8], \"user_created\": \"48c92147-ac9c-4f45-946b-9f3f664dd223\", \"user_updated\": \"48c92147-ac9c-4f45-946b-9f3f664dd223\"}', '{\"date_created\": \"2022-08-29T12:41:00.000Z\", \"date_updated\": \"2024-01-07T12:42:41.453Z\", \"user_updated\": \"48c92147-ac9c-4f45-946b-9f3f664dd223\"}', NULL, NULL),
(1306, 1339, 'news_translations', '5', '{\"id\": 5, \"title\": \"Контейнерные линии готовятся к замедлению темпов роста, поскольку ставки фрахта снижаются\", \"content\": \"<p>Последнее время мы наблюдаем самый прибыльный период в истории контейнерных перевозок, но наша отрасль привыкла к циклам бумов и спадов, поэтому ситуация всегда может измениться.</p>\\n<p>На прошлой неделе Всемирная торговая организация заявила, что торговые потоки замедлились в прошлом квартале и, скорее всего, останутся слабыми во второй половине года. Это все еще соответствует прогнозу ВТО о 3% росте мировой торговли товарами в 2022 году.</p>\\n<p>Однако организация выразила меньшую уверенность в этом прогнозе, учитывая, что геополитическая напряженность затягивается, инфляционное давление сохраняется, а процентные ставки растут.</p>\\n<p>Хорошая новость заключается в том, что некоторые проблемы с поставками ослабевают, а цены на топливо падают, что снимает некоторые сложности, связанные с логистическими расходами, которые влияли на балансы компаний. Но это также означает, что неожиданный всплеск прибыльности, вызванный пандемией, проходит.</p>\\n<p>Также на прошлой неделе аналитики Citi сократили прогноз по рейтингам Maersk, Hapag-Lloyd и Zim, ожидая более глубокого замедления мирового спроса, ссылаясь на несколько причин: сокращение потребления, снижение продаж домов в США и рост инфляции. Все это негативные предзнаменования для отрасли, которая обеспечивает около 80% мировой торговли.</p>\\n<p>Сейчас перевозчики, которые всего несколько месяцев назад имели нулевые свободные мощности, предлагают достаточно мест на судах, которые они размещают на ключевых торговых маршрутах, что привело к снижению краткосрочных ставок на контейнерные перевозки в течение шести месяцев подряд.</p>\\n<p>В прошлую среду компания Drewry сообщила, что спотовая ставка на эталонном маршруте из Азии в США упала до $4949 за 40-футовый контейнер, впервые с декабря 2020 года опустившись ниже $5000.</p>\\n<p>Компания Clarksons Research ожидает, что в 2022 году мощности контейнерной торговли будут опережать спрос на 300 базисных пунктов, что может привести к дальнейшему снижению контейнерных ставок.</p>\\n<p>Ожидается, что спотовые ставки на контейнерные перевозки продолжат снижаться, но останутся &laquo;значительно выше&raquo; своих допандемических уровней до конца 2022 года из-за сохраняющейся хрупкости мировых цепей поставок.</p>\", \"news_id\": 3, \"languages_code\": \"ru\"}', '{\"content\": \"<p>Последнее время мы наблюдаем самый прибыльный период в истории контейнерных перевозок, но наша отрасль привыкла к циклам бумов и спадов, поэтому ситуация всегда может измениться.</p>\\n<p>На прошлой неделе Всемирная торговая организация заявила, что торговые потоки замедлились в прошлом квартале и, скорее всего, останутся слабыми во второй половине года. Это все еще соответствует прогнозу ВТО о 3% росте мировой торговли товарами в 2022 году.</p>\\n<p>Однако организация выразила меньшую уверенность в этом прогнозе, учитывая, что геополитическая напряженность затягивается, инфляционное давление сохраняется, а процентные ставки растут.</p>\\n<p>Хорошая новость заключается в том, что некоторые проблемы с поставками ослабевают, а цены на топливо падают, что снимает некоторые сложности, связанные с логистическими расходами, которые влияли на балансы компаний. Но это также означает, что неожиданный всплеск прибыльности, вызванный пандемией, проходит.</p>\\n<p>Также на прошлой неделе аналитики Citi сократили прогноз по рейтингам Maersk, Hapag-Lloyd и Zim, ожидая более глубокого замедления мирового спроса, ссылаясь на несколько причин: сокращение потребления, снижение продаж домов в США и рост инфляции. Все это негативные предзнаменования для отрасли, которая обеспечивает около 80% мировой торговли.</p>\\n<p>Сейчас перевозчики, которые всего несколько месяцев назад имели нулевые свободные мощности, предлагают достаточно мест на судах, которые они размещают на ключевых торговых маршрутах, что привело к снижению краткосрочных ставок на контейнерные перевозки в течение шести месяцев подряд.</p>\\n<p>В прошлую среду компания Drewry сообщила, что спотовая ставка на эталонном маршруте из Азии в США упала до $4949 за 40-футовый контейнер, впервые с декабря 2020 года опустившись ниже $5000.</p>\\n<p>Компания Clarksons Research ожидает, что в 2022 году мощности контейнерной торговли будут опережать спрос на 300 базисных пунктов, что может привести к дальнейшему снижению контейнерных ставок.</p>\\n<p>Ожидается, что спотовые ставки на контейнерные перевозки продолжат снижаться, но останутся &laquo;значительно выше&raquo; своих допандемических уровней до конца 2022 года из-за сохраняющейся хрупкости мировых цепей поставок.</p>\", \"news_id\": \"3\", \"languages_code\": \"ru\"}', 1307, NULL),
