(1344, 1377, 'news_translations', '5', '{\"id\": 5, \"title\": \"Контейнерные линии готовятся к замедлению темпов роста, поскольку ставки фрахта снижаются\", \"content\": \"<p>Последнее время мы наблюдаем самый прибыльный период в истории контейнерных перевозок, но наша отрасль привыкла к циклам бумов и спадов, поэтому ситуация всегда может измениться.</p>\\n<p>На прошлой неделе Всемирная торговая организация заявила, что торговые потоки замедлились в прошлом квартале и, скорее всего, останутся слабыми во второй половине года. Это все еще соответствует прогнозу ВТО о 3% росте мировой торговли товарами в 2022 году.</p>\\n<p>Однако организация выразила меньшую уверенность в этом прогнозе, учитывая, что геополитическая напряженность затягивается, инфляционное давление сохраняется, а процентные ставки растут.</p>\\n<p>Хорошая новость заключается в том, что некоторые проблемы с поставками ослабевают, а цены на топливо падают, что снимает некоторые сложности, связанные с логистическими расходами, которые влияли на балансы компаний. Но это также означает, что неожиданный всплеск прибыльности, вызванный пандемией, проходит.</p>\\n<p>Также на прошлой неделе аналитики Citi сократили прогноз по рейтингам Maersk, Hapag-Lloyd и Zim, ожидая более глубокого замедления мирового спроса, ссылаясь на несколько причин: сокращение потребления, снижение продаж домов в США и рост инфляции. Все это негативные предзнаменования для отрасли, которая обеспечивает около 80% мировой торговли.</p>\\n<p>Сейчас перевозчики, которые всего несколько месяцев назад имели нулевые свободные мощности, предлагают достаточно мест на судах, которые они размещают на ключевых торговых маршрутах, что привело к снижению краткосрочных ставок на контейнерные перевозки в течение шести месяцев подряд.</p>\\n<p>В прошлую среду компания Drewry сообщила, что спотовая ставка на эталонном маршруте из Азии в США упала до $4949 за 40-футовый контейнер, впервые с декабря 2020 года опустившись ниже $5000.</p>\\n<p>Компания Clarksons Research ожидает, что в 2022 году мощности контейнерной торговли будут опережать спрос на 300 базисных пунктов, что может привести к дальнейшему снижению контейнерных ставок.</p>\\n<p>Ожидается, что спотовые ставки на контейнерные перевозки продолжат снижаться, но останутся &laquo;значительно выше&raquo; своих допандемических уровней до конца 2022 года из-за сохраняющейся хрупкости мировых цепей поставок.</p>\", \"news_id\": 3, \"meta_title\": \"Контейнерные линии готовятся к замедлению темпов роста, поскольку ставки фрахта снижаются\", \"languages_code\": \"ru\", \"meta_description\": \"Изучайте актуальные тенденции в мире контейнерных линий: узнайте, почему темпы роста замедляются и как снижение ставок фрахта влияет на индустрию. Будьте в курсе изменений в морской перевозке контейнеров.\"}', '{\"news_id\": \"3\", \"meta_title\": \"Контейнерные линии готовятся к замедлению темпов роста, поскольку ставки фрахта снижаются\", \"languages_code\": \"ru\", \"meta_description\": \"Изучайте актуальные тенденции в мире контейнерных линий: узнайте, почему темпы роста замедляются и как снижение ставок фрахта влияет на индустрию. Будьте в курсе изменений в морской перевозке контейнеров.\"}', 1346, NULL),
(1345, 1378, 'news_translations', '6', '{\"id\": 6, \"title\": \"Container lines are preparing for a slowdown in growth as freight rates decrease\", \"content\": \"<p>Recently, we have witnessed the most profitable period in the history of container shipping. However, our industry is accustomed to cycles of booms and downturns, so the situation can always change.</p>\\n<p>Last week, the World Trade Organization stated that trade flows slowed in the last quarter and are likely to remain weak in the second half of the year. This still aligns with the WTO\'s forecast of a 3% growth in global goods trade in 2022.</p>\\n<p>However, the organization expressed less confidence in this forecast, considering that geopolitical tensions persist, inflationary pressure remains, and interest rates are rising.</p>\\n<p>The good news is that some supply chain issues are easing, and fuel prices are dropping, alleviating some of the logistical cost challenges that affected company balances. But it also means that the unexpected profitability surge caused by the pandemic is fading.</p>\\n<p>Last week, Citi analysts lowered their ratings forecasts for Maersk, Hapag-Lloyd, and Zim, expecting a deeper slowdown in global demand, citing several reasons: reduced consumption, declining home sales in the United States, and inflationary growth. All of these are negative omens for an industry that facilitates about 80% of global trade.</p>\\n<p>Now carriers, who just a few months ago had zero idle capacity, are offering enough space on ships that they deploy on key trade routes, leading to a decline in short-term container shipping rates for six consecutive months.</p>\\n<p>Last Wednesday, Drewry reported that the spot rate on the benchmark route from Asia to the U.S. fell to $4949 for a 40-foot container, dropping below $5000 for the first time since December 2020.</p>\\n<p>Clarksons Research expects container shipping capacity to outpace demand by 300 basis points in 2022, which could lead to further reductions in container rates.</p>\\n<p>Spot rates for container shipping are expected to continue to decline but will remain \\\"significantly higher\\\" than their pre-pandemic levels until the end of 2022 due to the continued fragility of global supply chains.</p>\", \"news_id\": 3, \"meta_title\": \"Container lines are preparing for a slowdown in growth as freight rates decline\", \"languages_code\": \"en\", \"meta_description\": \"Explore current trends in the world of container lines: find out why growth rates are slowing down and how the decrease in freight rates is impacting the industry. Stay informed about changes in container shipping.\"}', '{\"news_id\": \"3\", \"meta_title\": \"Container lines are preparing for a slowdown in growth as freight rates decline\", \"languages_code\": \"en\", \"meta_description\": \"Explore current trends in the world of container lines: find out why growth rates are slowing down and how the decrease in freight rates is impacting the industry. Stay informed about changes in container shipping.\"}', 1346, NULL),
