(1478, 1512, 'containers_translations', '11', '{\"id\": 11, \"title\": \"20-ти футовый рефрижераторный (стальной) контейнер\", \"description\": \"Рефрижераторные контейнеры применяются для перевозки и хранения продуктов, требующих определенной температурной обстановки. Идеальны для перевозки свежих продуктов, медицинских препаратов и других грузов, требующих холодильных условий, обеспечивают сохранность качества и безопасность перевозимых товаров.\", \"containers_id\": 11, \"languages_code\": \"ru\"}', '{\"description\": \"Рефрижераторные контейнеры применяются для перевозки и хранения продуктов, требующих определенной температурной обстановки. Идеальны для перевозки свежих продуктов, медицинских препаратов и других грузов, требующих холодильных условий, обеспечивают сохранность качества и безопасность перевозимых товаров.\", \"containers_id\": \"11\", \"languages_code\": \"ru\"}', 1480, NULL),
(1479, 1513, 'containers_translations', '24', '{\"id\": 24, \"title\": \"20-foot refrigerated (steel) container\", \"description\": \"Refrigerated containers are used for transporting and storing goods that require specific temperature conditions. Ideal for the transportation of fresh produce, medical supplies, and other cargoes requiring refrigeration, they ensure the preservation of quality and safety of the transported goods.\", \"containers_id\": 11, \"languages_code\": \"en\"}', '{\"description\": \"Refrigerated containers are used for transporting and storing goods that require specific temperature conditions. Ideal for the transportation of fresh produce, medical supplies, and other cargoes requiring refrigeration, they ensure the preservation of quality and safety of the transported goods.\", \"containers_id\": \"11\", \"languages_code\": \"en\"}', 1480, NULL),
