(1, 1, 'ru', 'Логистические решения', 'для вашего бизнеса', 'MLS - Логистические решения для вашего бизнеса, контейнерные перевозки из Китая в Россию', 'MLS предоставляет логистические решения высокого уровня для вашего бизнеса. Оптимальные контейнерные перевозки из Китая в Россию. Готовы к воплощению ваших логистических задач.', '<p><span style=\"color: rgb(231, 237, 82);\">Эксперты в контейнерных перевозках</span> из Китая в Россию</p>', 'Контейнерные перевозки', 'Предлагаем полный спектр транспортных услуг: контейнерные перевозки в порты Дальнего Востока, Санкт-Петербурга и Новороссийска, а также железнодорожные перевозки контейнеров из Китая в Россию. Помимо этого, мы осуществляем автомобильные и авиаперевозки грузов.', 'Логистика без границ', 'Эксперты в логистике, готовы к любым вызовам рынка.'),
(2, 1, 'en', 'Logistics solutions', 'for your business', 'MLS - Logistics Solutions for Your Business, Container Shipping from China to Russia.', 'MLS offers high-level logistics solutions for your business. Optimal container shipping from China to Russia. Ready to tackle your logistical challenges.', '<p><span style=\"color: rgb(231, 237, 82);\">Experts in container transportation</span> from China to Russia</p>', 'Container shipping', 'We offer a full range of transportation services, including container shipping to the ports of the Russian Far East, St. Petersburg, and Novorossiysk, as well as railway transportation of containers from China to Russia. In addition, we provide trucking and air freight services for cargo.', 'Logistics without borders', 'Logistics experts, ready for any challenges of the market.');
