INSERT INTO `news_translations` (`id`, `news_id`, `languages_code`, `title`, `content`, `meta_title`, `meta_description`) VALUES
(5, 3, 'ru', 'Контейнерные линии готовятся к замедлению темпов роста, поскольку ставки фрахта снижаются', '<p>Последнее время мы наблюдаем самый прибыльный период в истории контейнерных перевозок, но наша отрасль привыкла к циклам бумов и спадов, поэтому ситуация всегда может измениться.</p>\n<p>На прошлой неделе Всемирная торговая организация заявила, что торговые потоки замедлились в прошлом квартале и, скорее всего, останутся слабыми во второй половине года. Это все еще соответствует прогнозу ВТО о 3% росте мировой торговли товарами в 2022 году.</p>\n<p>Однако организация выразила меньшую уверенность в этом прогнозе, учитывая, что геополитическая напряженность затягивается, инфляционное давление сохраняется, а процентные ставки растут.</p>\n<p>Хорошая новость заключается в том, что некоторые проблемы с поставками ослабевают, а цены на топливо падают, что снимает некоторые сложности, связанные с логистическими расходами, которые влияли на балансы компаний. Но это также означает, что неожиданный всплеск прибыльности, вызванный пандемией, проходит.</p>\n<p>Также на прошлой неделе аналитики Citi сократили прогноз по рейтингам Maersk, Hapag-Lloyd и Zim, ожидая более глубокого замедления мирового спроса, ссылаясь на несколько причин: сокращение потребления, снижение продаж домов в США и рост инфляции. Все это негативные предзнаменования для отрасли, которая обеспечивает около 80% мировой торговли.</p>\n<p>Сейчас перевозчики, которые всего несколько месяцев назад имели нулевые свободные мощности, предлагают достаточно мест на судах, которые они размещают на ключевых торговых маршрутах, что привело к снижению краткосрочных ставок на контейнерные перевозки в течение шести месяцев подряд.</p>\n<p>В прошлую среду компания Drewry сообщила, что спотовая ставка на эталонном маршруте из Азии в США упала до $4949 за 40-футовый контейнер, впервые с декабря 2020 года опустившись ниже $5000.</p>\n<p>Компания Clarksons Research ожидает, что в 2022 году мощности контейнерной торговли будут опережать спрос на 300 базисных пунктов, что может привести к дальнейшему снижению контейнерных ставок.</p>\n<p>Ожидается, что спотовые ставки на контейнерные перевозки продолжат снижаться, но останутся &laquo;значительно выше&raquo; своих допандемических уровней до конца 2022 года из-за сохраняющейся хрупкости мировых цепей поставок.</p>', 'Контейнерные линии готовятся к замедлению темпов роста, поскольку ставки фрахта снижаются', 'Изучайте актуальные тенденции в мире контейнерных линий: узнайте, почему темпы роста замедляются и как снижение ставок фрахта влияет на индустрию. Будьте в курсе изменений в морской перевозке контейнеров.'),
(6, 3, 'en', 'Container lines are preparing for a slowdown in growth as freight rates decrease', '<p>Recently, we have witnessed the most profitable period in the history of container shipping. However, our industry is accustomed to cycles of booms and downturns, so the situation can always change.</p>\n<p>Last week, the World Trade Organization stated that trade flows slowed in the last quarter and are likely to remain weak in the second half of the year. This still aligns with the WTO\'s forecast of a 3% growth in global goods trade in 2022.</p>\n<p>However, the organization expressed less confidence in this forecast, considering that geopolitical tensions persist, inflationary pressure remains, and interest rates are rising.</p>\n<p>The good news is that some supply chain issues are easing, and fuel prices are dropping, alleviating some of the logistical cost challenges that affected company balances. But it also means that the unexpected profitability surge caused by the pandemic is fading.</p>\n<p>Last week, Citi analysts lowered their ratings forecasts for Maersk, Hapag-Lloyd, and Zim, expecting a deeper slowdown in global demand, citing several reasons: reduced consumption, declining home sales in the United States, and inflationary growth. All of these are negative omens for an industry that facilitates about 80% of global trade.</p>\n<p>Now carriers, who just a few months ago had zero idle capacity, are offering enough space on ships that they deploy on key trade routes, leading to a decline in short-term container shipping rates for six consecutive months.</p>\n<p>Last Wednesday, Drewry reported that the spot rate on the benchmark route from Asia to the U.S. fell to $4949 for a 40-foot container, dropping below $5000 for the first time since December 2020.</p>\n<p>Clarksons Research expects container shipping capacity to outpace demand by 300 basis points in 2022, which could lead to further reductions in container rates.</p>\n<p>Spot rates for container shipping are expected to continue to decline but will remain \"significantly higher\" than their pre-pandemic levels until the end of 2022 due to the continued fragility of global supply chains.</p>', 'Container lines are preparing for a slowdown in growth as freight rates decline', 'Explore current trends in the world of container lines: find out why growth rates are slowing down and how the decrease in freight rates is impacting the industry. Stay informed about changes in container shipping.'),
(7, 4, 'ru', 'Контейнеры становятся дешевле', '<p>Средние цены на контейнеры снизились более чем наполовину по сравнению с августом прошлого года, поскольку Китай в последнее время набирает объемы контейнерной торговли, согласно анализу, опубликованному платформой Container xChange:</p>\n<p>&laquo;Сейчас пик сезона морских перевозок, и отрасль ожидает интенсивного оттока контейнеров из Китая для выполнения заказов из центров спроса. В этом году мы не наблюдали двух ключевых тенденций, которые были нормой в это время в предыдущие годы - роста арендных ставок и цен на контейнеры в Китае и снижения стоимости Шанхайского индекса доступности контейнеров (CAx)&raquo;</p>\n<p>В своем анализе они подчеркивают, что индекс CAx растет от недели к неделе и значительно превышает уровни 2020 и 2019 годов. По мнению Container xChange, это потенциально может означать, что в Китае больше контейнеров по сниженным ценам, что облегчает грузоотправителям и экспедиторам планирование перевозок из Китая.</p>\n<p>Также они отмечают снижение на 17% ставок аренды контейнеров в одну сторону из Китая в США с июня по июль. Кроме того, цена стандартного контейнера, по их данным, упала вдвое по сравнению с августом 2021 года и настоящим временем.</p>\n<p>&laquo;Снижение средних цен на контейнеры и ставок аренды открывает хорошие возможности для грузоотправителей и экспедиторских компаний, поскольку цепочка поставок готовится к пиковому сезону, который обычно длится с июля по сентябрь&raquo;</p>', NULL, NULL),
(8, 4, 'en', 'Containers are becoming cheaper', '<p>Average prices for containers have decreased by more than half compared to August of last year as China is currently ramping up container trade volumes, according to an analysis published by the Container xChange platform:</p>\n<p>\"Now is the peak season for maritime shipments, and the industry anticipates a significant outflow of containers from China to fulfill orders from demand centers. This year, we have not observed two key trends that were the norm at this time in previous years - an increase in rental rates and container prices in China and a decrease in the cost of the Shanghai Container Availability Index (CAx).\"</p>\n<p>In their analysis, they emphasize that the CAx index is growing from week to week and significantly surpasses the levels of 2020 and 2019. According to Container xChange, this could potentially mean that there are more containers in China at reduced prices, making it easier for shippers and freight forwarders to plan shipments from China.</p>\n<p>They also note a 17% decrease in one-way container rental rates from China to the U.S. from June to July. Additionally, the price of a standard container, according to their data, has halved compared to August 2021 and the present time.</p>\n<p>\"The decrease in average container prices and rental rates opens up good opportunities for shippers and freight forwarding companies as the supply chain prepares for the peak season, which typically lasts from July to September.\"</p>', NULL, NULL),
