(3, 'published', NULL, '48c92147-ac9c-4f45-946b-9f3f664dd223', '2024-01-04 12:01:46', '48c92147-ac9c-4f45-946b-9f3f664dd223', '2024-01-05 16:53:41', 'Екатерина', 'Превосходный сервис! Постоянно выбираю эту компанию. Быстрое и качественное обслуживание, удобные локации. Проблемы решают оперативно.', 'b98cbfa2-cf86-472b-804a-f6d6d829230e', 'ru');
